class Solution:
    def solve(self, seq: str) -> float:
        L = [0] * len(seq)
        L[0] = 0
        for i in range(1, len(seq)):
            if seq[i] == "H":
                L[i] = L[i - 1] + 1
            else:
                L[i] = 0
        return sum(L) / len(L)

