    def __init__(self, N, A_cables, B_cables):
        self.N = N
        self.A_cables = A_cables
        self.B_cables = B_cables
        self.graph = {}

    def add_edge(self, u, v, cost):
        if u not in self.graph:
            self.graph[u] = {}
        if v not in self.graph:
            self.graph[v] = {}
        self.graph[u][v] = cost
        self.graph[v][u] = cost

    def bellman_ford(self, start):
        for _ in range(self.N - 1):
            for u, adj in self.graph.items():
                for v, weight in adj.items():
                    self.graph[u][v] = min(self.graph[u].get(v, float('inf')), self.graph[u][v] + weight)
        for u, adj in self.graph.items():
            for v, weight in adj.items():
                self.graph[u][v] = min(self.graph[u].get(v, float('inf')), self.graph[u][v] + weight)

    def min_trans_cost(self, start):
        self.bellman_ford(start)
        cost = sum(sum(self.graph[u].get(v, float('inf')) for v in self.graph[u]) for u in self.graph)
        return cost

